import * as actionType from './ActionTypes'

export const ACTION_USER_LOGIN = {
    type : actionType.USER_LOGIN,
    payload : {      
        username : undefined
    }
}
export const ACTION_USER_LOGOUT = {
    type : actionType.USER_LOGOUT
}
